import React from "react";
import {Link} from "react-router-dom";
const Navbar = () => {
    return (
        <div className="navbar">
            <div className="container">
                <div className="logo">logo</div>
                <div className="links">
                    <Link className="link" to ="/profile">
                        <h6>Profile</h6>
                    </Link>
                </div>
            </div>
        </div>
    )
}

export default Navbar
